var tipuesearch = {"pages":[{"title":"About","text":"2016Fall 修課成員網誌","url":"./pages/about/","tags":"misc"},{"title":"40423145 廖先博","text":"9.22筆記 網址:http://chiamingyen.github.io/kmolab/blog/index.html 下載網址:140.130.17.17(只能在學校裡使用) 2016fall裡的檔案倒數兩個擇一下載(ana2016fall_os(3.0g)or mini2016fall.7z(98m)) 1.創2016fallcadp_hw 將README打勾 格式:python 加密:agpl 新增gh-pages分支 進入setting 點branches 將master變更為gh-pages 2.git clone 2016fallcadp_hw cd 2016fallcadp_hw git branch git checkout gh-pages git branch(再次檢查) 3.創 學號.github.io 將README打勾 格式:python 加密:agpl 點選create new file 打入index.html 點commit new file 4.創 2016fallcadp_ag100(組別) 將README打勾 格式:python 加密:agpl 將2016fallcadp_ag100 clone下來 cd 2016fallcadp_ag100 git branch git checkout gh-pages git branch(再次檢查) 將自己的2016fallcadp_hw clone網址複製 git submodule add -b gh-pages 網址 學號 git staus(檢查) 依序將隊友的資料夾加入 git add -A git commit -m \"名稱\" git push origin gh-pages 完成 9.29筆記 錄影工具:sharex 1.paths 2.task → screen recorder → options 開始錄製:shift+ print screen 10.6筆記 proxy設定:proxy.mde.tw 通訊阜:3128 去聲音指令:ffmpeg.exe -i 檔名 -c copy -an out.mp4 字幕指令:ffmpeg.exe -i out.mp4 -vf subtitles=in.srt out2.mp4 安裝pelican指令:pip install pelican","url":"./40423145-liao-xian-bo.html","tags":"上課筆記"},{"title":"2016.09.22","text":"2016.09.22 NOTE 1.先到 https://github.com/mdecourse 的 2016cadp 按 Fork 2.在自己的github帳號創立一個 2016fallcadp_hw倉儲 把最下面的 Add.gitignore輸入 Python Add a license輸入 Agpl 3.在 2016fallcadp_hw倉儲 建立gh-pages分支 4.按上方的一個setting-branches-選擇gh-pages 5.在系上的電腦 輸入 140.130.17.17/2016fall 下載近端的python 6.在自己的帳號建立 40423146.github.io 說明打 my home page 把最下面的 Add.gitignore輸入 Python Add a license輸入 Agpl 7.在 40423146.github.io倉儲的左上角有一個 Create new file點進去 新增40423146.github.io.index.html 就會有自己的網頁了 8.進入 https://github.com/mdecourse/2016fallcadp/wiki 的上課筆記 下載繪圖軟體練習零件繪製: http://solvespace.com/bracket.pl","url":"./20160922.html","tags":"w1"}]};